import * as React from 'react';
import { Text,TextInput,View, ImageBackground,StyleSheet } from 'react-native';
import { Icon,Button } from 'react-native-elements'

const imgFooter = require('../assets/reg.jpg');

export default class RegisterProfScreen extends React.Component {
  static navigationOptions ={
    header: null
  }

  render() {
    return (
          <View style={styles.container}>
            <View style={styles.containerTitle} >
              <Text>Pantalla Profes</Text>
            </View>

            <View style={styles.containerRegister}>
              <View style={styles.containerUserName}>
              <Icon type="font-awesome" name="user" color="gray" containerStyle={styles.icon}/>
              <TextInput placeholder="Nombre y apellido" placeholderTextColor="gray"
              style={styles.textInput}/> 
              </View>

              <View style={styles.containerPassword}>
                <Icon type="entypo" name="key" color="gray" containerStyle={styles.icon}/>
                <TextInput placeholder="Email" placeholderTextColor="gray"
                style={styles.textInput} secureTextEntry={true}/> 
              </View>

              <View style={styles.containerSignIn}>
                <Button title='REGISTRARSE' backgroundColor='#ffa100'
                borderRadius={20}/>
              </View>

              
            </View>
            
            
                             
            
            
          </View>        
    );
  }
}

const styles = StyleSheet.create({
  container:{
    flex:1,
    flexDirection: 'column',
    justifyContent:'center',
    alignItems: 'stretch',
    width:'100%',
    height:'100%'
  },
  containerTitle:{
    flex:1,
    alignItems:'center',
    title:{
      color:'#4c4545',
      fontWeight: 'bold',
      fontSize: 18,
      paddingTop:'12%'
    }
  },
  containerRegister:{
    flex:2,
    marginLeft:'3%',
    marginRight:'3%',
    borderBottomColor: 'gray',
    borderBottomWidth: 1,
  },
  containerSocial:{
    flex:1,
    justifyContent:'center',
    backgroundColor:'##ECE7E3',
    buttonsSocial:{
      flexDirection:'row',
      justifyContent:'space-around',
      paddingBottom:'3%'
    }
  },
  containerSignIn:{
    height: 50,
    marginLeft:'12%',
    marginRight:'12%',
    marginTop:'9%'
  },
  containerUserName:{
    height: 50,
    flexDirection:'row',
    justifyContent:'center',
    backgroundColor:'white',
    marginLeft:'10%',
    marginRight:'10%',
    
  },
  containerPassword:{
    height: 50,
    flexDirection:'row',
    justifyContent:'center',
    backgroundColor:'white',
    marginLeft:'10%',
    marginRight:'10%',
    marginTop:'2%'
  },
  containerOR:{
    position: 'absolute',
    bottom:0,  
    alignSelf:'center',
    height:'12%',
    width:'12%',
  },
  icon:{
    flex:1
  },
  textInput:{
    backgroundColor:'transparent',
    flex:5,
    color:'black',
    paddingLeft:'25%'
  }
})
